DROP TABLE IF EXISTS `tbl_transaction`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tbl_transaction` (
  `tid` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自编号',
  `tno` varchar(10) NOT NULL COMMENT '交易流水号',
  `tdate` varchar(10) NOT NULL COMMENT '交易日期',
  `uno` varchar(5) NOT NULL COMMENT '客户编号',
  `pno` varchar(5) NOT NULL COMMENT '产品编号',
  `tnum` int(4) NOT NULL COMMENT '购买数量',
  `tuptime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '记录更新时间',
  PRIMARY KEY (`tid`),
  UNIQUE KEY `tno` (`tno`),
  KEY `tdate` (`tdate`),
  KEY `tcustomer` (`uno`),
  KEY `tproduct` (`pno`)
) ENGINE=InnoDB AUTO_INCREMENT=49875 DEFAULT CHARSET=utf8mb4 COMMENT='交易流水数据表';
/*!40101 SET character_set_client = @saved_cs_client */;

